import avatar from '../../styles/'

function Profile() {
   return(
      <div className="fullscreen__profile profile">
         <div className="profile__header">
            <div className="profile__image">
            <img src={avatar} alt="avatar" />
            </div>
         </div>
      </div>
   )
}

export default Profile
